ring women to get involved in the music industry.

In case you missed Tuesday’s post, SwanaSounds is a new project to share music made by women from the  swana region. I’ll be dropping 25 SwanaSounds on the 1st of each month & feature 1 artist on our blog to dive into my reasons for being so drawn to them.

Check out the link in our bio to read the full piece on Felukah my reasons for choosing her as our 1st #SwanaSounds feature! - Here’s an excerpt from the blog:

“To me, music is the purest form of communication and the highest form of self-expression. And artists like Felukah are the reason why. Everything from a song’s lyrics and sound to it’s album cover, embodies an artist's vision. It brings their human experience to life. And allows for their listeners to understand their message through a musical medium.  That’s the unique power musicians have. They create a product that the listener identifies with. They put our feelings into words we couldn’t write, and sounds we couldn’t create. 

Felukah is more than a gifted creative, she’s a dreamer. Someone who was able to tap into her soul, expand her passion for language and poetry into a project that presents so much opportunity for change. She expresses her message through a variety of mediums, simultaneously. Felukah without a doubt deserves our attention as a creative, a symbol of empowerment to the Arab and non-Arab women hesitant to start their careers in whatever industry they aspire to enter.”";}i:238;a:1:{s:14:"comments_count";i:2;}i:239;a:1:{s:11:"likes_count";i:23;}i:240;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEupko-H3mr";}i:241;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118555642_959965157803884_4874255652459915946_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=lCfPOpxSsoAAX9b5wCg&_nc_tp=18&oh=92697a38045898c6ab7b8fc13da70b43&oe=5F7BD01D";}i:242;a:1:{s:4:"type";s:7:"sidecar";}i:243;a:1:{s:8:"owner_id";i:25561759098;}i:244;a:1:{s:14:"owner_username";s:0:"";}i:245;a:1:{s:14:"owner_fullname";s:0:"";}i:246;a:1:{s:9:"owner_pic";s:0:"";}i:247;a:1:{s:2:"id";s:19:"2391030676177835461";}i:248;a:1:{s:10:"short_code";s:11:"CEupbtUpFXF";}i:249;a:1:{s:12:"created_time";i:1599253125;}i:250;a:1:{s:7:"caption";s:166:"🥌🥌🥌

